    event CreateLimitOrder(address indexed user, uint256 indexed id);

    event CancelLimitOrder(address indexed user, uint256 indexed id);

    event AutoSell(address indexed user, uint256 indexed id);

    event AutoBuy(address indexed user, uint256 indexed id);

    event AutoTakeProfit(address indexed user, uint256 indexed id);

    event AutoStoploss(address indexed user, uint256 indexed id);

    event UpdateLimit(
        address indexed user,
        uint256 indexed id,
        uint256 priceEntry,
        uint256 priceTakeProfit,
        uint256 priceStopLoss
    );

    constructor(
        address _privateWrapperFactory,
        address _illuminexRouter,
        address _ethUSDT,
        uint48 _FEE_RATE,
        uint48 _FEE_RATE_TPSL
    ) Ownable(msg.sender) {
        privateWrapperFactory = _privateWrapperFactory;
        illuminexRouter = _illuminexRouter;
        ethUSDT = _ethUSDT;
        FEE_RATE = _FEE_RATE;
        FEE_RATE_TPSL = _FEE_RATE_TPSL;
    }

    function createLimitOrder(
        Request.Side side,
        address tokenUse,
        address tokenInteract,
        uint256 amountEntry,
        uint256 priceEntry,
        uint256 priceTakeProfit,
        uint256 priceStopLoss,
        uint256 slippage
    ) external {
        numOrder[msg.sender]++;
        uint256 id = numOrder[msg.sender];
        if (id == 1) {
            users[numUser] = msg.sender;
            numUser++;
        }
        SafeERC20.safeTransferFrom(
            IERC20(tokenUse),
            msg.sender,
            address(this),
            amountEntry
        );

        address privateToken = IPrivateWrapperFactory(privateWrapperFactory)
            .wrappers(tokenUse);

        IERC20(privateToken).approve(privateWrapperFactory, amountEntry);

        IPrivateWrapperFactory(privateWrapperFactory).wrap(
            privateToken,
            amountEntry,
            address(this)
        );
        uint48 fee = FEE_RATE;
        if (side == Request.Side.BuyTPSL || side == Request.Side.SellTPSL) {
            fee = FEE_RATE_TPSL;
        }

        orders[msg.sender][id] = LimitOrder(
            id,
            side,
            tokenUse,
            tokenInteract,
            amountEntry,
            priceEntry,
            0,
            priceTakeProfit,
            priceStopLoss,
            0,
            slippage,
            fee,
            Request.Status.Swaptime,
            block.timestamp
        );
        emit CreateLimitOrder(msg.sender, id);
    }

    function cancelLimitOrder(uint256 id) external {
        LimitOrder storage order = orders[msg.sender][id];

        require(order.status == Request.Status.Swaptime, "Invalid status");
        order.status = Request.Status.Canceled;
        _transfer(order.tokenUse, order.amountEntry, msg.sender, 0);
        emit CancelLimitOrder(msg.sender, id);
    }

    function autoSell(uint256 id, address[] calldata path) external {
        LimitOrder storage order = orders[msg.sender][id];
        require(order.status == Request.Status.Swaptime, "Invalid status");
        require(
            order.side == Request.Side.Sell ||
                order.side == Request.Side.SellTPSL,
            "Invalid side"
        );
        require(
            assetPrice(order.tokenUse) >=
                downSlippage(order.priceEntry, order.slippage),
            "Invalid price"
        );
        order.amountPhase1 = _swap(
            order.tokenUse,
            order.tokenInteract,
            order.amountEntry,
            order.priceEntry,
            path,
            address(this)
        );
        if (order.side == Request.Side.SellTPSL) {
            order.status = Request.Status.ProfitTime;
        }
        if (order.side == Request.Side.Sell) {
            order.status = Request.Status.SwapSuccess;
            _transfer(
                order.tokenInteract,
                order.amountPhase1,
                msg.sender,
                order.feeRate
            );
        }
        emit AutoSell(msg.sender, id);
    }

    function autoBuy(uint256 id, address[] calldata path) external {
        LimitOrder storage order = orders[msg.sender][id];
        require(order.status == Request.Status.Swaptime, "Invalid status");

        require(
            assetPrice(order.tokenInteract) <=
                upSlippage(order.priceEntry, order.slippage),
            "Invalid price"
        );

        order.amountPhase1 = _swap(
            order.tokenUse,
            order.tokenInteract,
            order.amountEntry,
            order.priceEntry,
            path,
            address(this)
        );
        if (order.side == Request.Side.BuyTPSL) {
            order.status = Request.Status.ProfitTime;
        }
        if (order.side == Request.Side.Buy) {
            order.status = Request.Status.SwapSuccess;
            _transfer(
                order.tokenInteract,
                order.amountPhase1,
                msg.sender,
                order.feeRate
            );
        }
        emit AutoBuy(msg.sender, id);
    }

    function autoTakeProfit(uint256 id, address[] calldata path) external {
        LimitOrder storage order = orders[msg.sender][id];
        if (order.side == Request.Side.BuyTPSL) {
            require(
                order.status == Request.Status.ProfitTime,
                "Invalid status"
            );
            require(
                assetPrice(order.tokenInteract) >=
                    downSlippage(order.priceTakeProfit, order.slippage),
                "Invalid price"
            );
            order.amountPhase2 = _swap(
                order.tokenInteract,
                order.tokenUse,
                order.amountPhase1,
                0,
                path,
                address(this)
            );
            order.status = Request.Status.Profited;
            _transfer(
                order.tokenUse,
                order.amountPhase2,
                msg.sender,
                order.feeRate
            );
        }

        if (order.side == Request.Side.SellTPSL) {
            require(
                order.status == Request.Status.ProfitTime,
                "Invalid status"
            );
            require(
                assetPrice(order.tokenUse) <=
                    upSlippage(order.priceTakeProfit, order.slippage),
                "Invalid price"
            );
            order.amountPhase2 = _swap(
                order.tokenInteract,
                order.tokenUse,
                order.amountPhase1,
                0,
                path,
                address(this)
            );
            order.status = Request.Status.Profited;
            _transfer(
                order.tokenUse,
                order.amountPhase2,
                msg.sender,
                order.feeRate
            );
        }
        emit AutoTakeProfit(msg.sender, id);
    }

    function autoStoploss(uint256 id, address[] calldata path) external {
        LimitOrder storage order = orders[msg.sender][id];

        if (order.side == Request.Side.BuyTPSL) {
            require(
                order.status == Request.Status.ProfitTime,
                "Invalid status"
            );
            require(
                assetPrice(order.tokenInteract) <=
                    upSlippage(order.priceStopLoss, order.slippage),
                "Invalid price"
            );
            order.amountPhase2 = _swap(
                order.tokenInteract,
                order.tokenUse,
                order.amountPhase1,
                0,
                path,
                address(this)
            );
            order.status = Request.Status.Stoplossed;
            _transfer(
                order.tokenUse,
                order.amountPhase2,
                msg.sender,
                order.feeRate
            );
        }
        if (order.side == Request.Side.SellTPSL) {
            require(
                order.status == Request.Status.ProfitTime,
                "Invalid status"
            );
            require(
                assetPrice(order.tokenUse) >=
                    downSlippage(order.priceStopLoss, order.slippage),
                "Invalid price"
            );
            order.amountPhase2 = _swap(
                order.tokenInteract,
                order.tokenUse,
                order.amountPhase1,
                0,
                path,
                address(this)
            );
            order.status = Request.Status.Stoplossed;
            _transfer(
                order.tokenUse,
                order.amountPhase2,
                msg.sender,
                order.feeRate
            );
        }
        emit AutoStoploss(msg.sender, id);
    }

    function updateLimitPrice(
        uint256 id,
        uint256 priceEntry,
        uint256 priceTakeProfit,
        uint256 priceStoploss
    ) external {
        LimitOrder storage order = orders[msg.sender][id];

        if (priceEntry != order.priceEntry) {
            require(order.status == Request.Status.Swaptime, "Invalid status");
            order.priceEntry = priceEntry;
            if (
                order.status == Request.Status.ProfitTime ||
                order.status == Request.Status.Swaptime
            ) {
                order.priceStopLoss = priceStoploss;
                order.priceTakeProfit = priceTakeProfit;
            }
        }
        emit UpdateLimit(
            msg.sender,
            id,
            order.priceEntry,
            order.priceTakeProfit,
            order.priceStopLoss
        );
    }

    function _swap(
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address receiver
    ) internal returns (uint256) {
        address privateTokenIn = IPrivateWrapperFactory(privateWrapperFactory)
            .wrappers(tokenIn);
        address privateTokenOut = IPrivateWrapperFactory(privateWrapperFactory)
            .wrappers(tokenOut);

        require(privateTokenIn == path[0], "Invalid input path");

        require(
            privateTokenOut == path[path.length - 1],
            "Invalid output path"
        );

        IERC20(privateTokenIn).approve(illuminexRouter, amountIn);

        return
            ILuminexRouterV1(illuminexRouter).swapExactTokensForTokens(
                amountIn,
                amountOutMin,
                path,
                receiver,
                block.timestamp
            )[path.length - 1];
    }

    function _transfer(
        address token,
        uint256 amount,
        address receiver,
        uint48 fee
    ) internal {
        address privateToken = IPrivateWrapperFactory(privateWrapperFactory)
            .wrappers(token);
        IERC20(privateToken).approve(privateWrapperFactory, amount);
        IPrivateWrapperFactory(privateWrapperFactory).unwrap(
            privateToken,
            amount,
            receiver
        );

        fees[token] += (amount * fee) / FEE_RATE_PRECISION;

        uint256 amountOut = (amount * (FEE_RATE_PRECISION - fee)) /
            FEE_RATE_PRECISION;

        SafeERC20.safeTransfer(IERC20(token), receiver, amountOut);
    }

    function assetPrice(address token) public view returns (uint256 amountOut) {
        uint256 oneUnit;
        if (ERC20(token).decimals() == 6) {
            oneUnit = 1e6;
        } else {
            oneUnit = 1e18;
        }
        amountOut = getPriceTokenByIlluminex(oneUnit, token, ethUSDT);
    }

    function getPriceTokenByIlluminex(
        uint256 amountIn,
        address tokenIn,
        address tokenOut
    ) public view returns (uint256) {
        address privateTokenIn = IPrivateWrapperFactory(privateWrapperFactory)
            .wrappers(tokenIn);

        address privateTokenOut = IPrivateWrapperFactory(privateWrapperFactory)
            .wrappers(tokenOut);
        address[] memory path = new address[](2);
        path[0] = privateTokenIn;
        path[1] = privateTokenOut;
        return
            ILuminexRouterV1(illuminexRouter).getAmountsOut(amountIn, path)[1];
    }

    function downSlippage(
        uint256 value,
        uint256 slippage
    ) public pure returns (uint256) {
        return (value * (SLIPPAGE_PRECISION - slippage)) / SLIPPAGE_PRECISION;
    }

    function upSlippage(
        uint256 value,
        uint256 slippage
    ) public pure returns (uint256) {
        return (value * (SLIPPAGE_PRECISION + slippage)) / SLIPPAGE_PRECISION;
    }

    //region Admin functions

    function withdrawFee(address token, address receiver) external onlyOwner {
        uint256 amount = fees[token];
        fees[token] = 0;
        SafeERC20.safeTransfer(IERC20(token), receiver, amount);
    }

    function changeFeeRate(uint48 feeRate) external onlyOwner {
        FEE_RATE = feeRate;
    }

    function changeFeeRateTPSL(uint48 feeRate) external onlyOwner {
        FEE_RATE_TPSL = feeRate;
    }
}
